import React, { useEffect, useRef, useState } from 'react';
import { useLocation } from 'react-router-dom';

function InterviewPage() {
  const [isRecording, setIsRecording] = useState(false);
  const [audioContext, setAudioContext] = useState(null);
  const interviewerCanvasRef = useRef(null);
  const intervieweeCanvasRef = useRef(null);
  const location = useLocation(); // Access the name passed from NameInputPage

  useEffect(() => {
    // Initialize Web Audio API for interviewer audio
    const context = new (window.AudioContext || window.webkitAudioContext)();
    setAudioContext(context);

    const loadInterviewerAudio = async () => {
      const response = await fetch('/assets/demo.wav');
      const arrayBuffer = await response.arrayBuffer();
      const audioBuffer = await context.decodeAudioData(arrayBuffer);

      const source = context.createBufferSource();
      source.buffer = audioBuffer;

      const analyser = context.createAnalyser();
      analyser.fftSize = 2048;

      const bufferLength = analyser.frequencyBinCount;
      const dataArray = new Uint8Array(bufferLength);

      source.connect(analyser);
      analyser.connect(context.destination);
      source.start();

      const canvas = interviewerCanvasRef.current;
      const canvasCtx = canvas.getContext('2d');

      const draw = () => {
        requestAnimationFrame(draw);

        analyser.getByteTimeDomainData(dataArray);
        canvasCtx.clearRect(0, 0, canvas.width, canvas.height);

        canvasCtx.lineWidth = 2;
        canvasCtx.strokeStyle = '#4A90E2';

        canvasCtx.beginPath();
        const sliceWidth = (canvas.width * 1.0) / bufferLength;
        let x = 0;

        for (let i = 0; i < bufferLength; i++) {
          const v = dataArray[i] / 128.0;
          const y = (v * canvas.height) / 2;

          if (i === 0) {
            canvasCtx.moveTo(x, y);
          } else {
            canvasCtx.lineTo(x, y);
          }

          x += sliceWidth;
        }

        canvasCtx.lineTo(canvas.width, canvas.height / 2);
        canvasCtx.stroke();
      };

      draw();
    };

    loadInterviewerAudio();
  }, []);

  const startRecording = async () => {
    const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
    const context = audioContext || new (window.AudioContext || window.webkitAudioContext)();
    setAudioContext(context);

    const analyser = context.createAnalyser();
    analyser.fftSize = 2048;

    const source = context.createMediaStreamSource(stream);
    source.connect(analyser);

    const bufferLength = analyser.frequencyBinCount;
    const dataArray = new Uint8Array(bufferLength);

    const canvas = intervieweeCanvasRef.current;
    const canvasCtx = canvas.getContext('2d');

    const draw = () => {
      requestAnimationFrame(draw);

      analyser.getByteTimeDomainData(dataArray);
      canvasCtx.clearRect(0, 0, canvas.width, canvas.height);

      canvasCtx.lineWidth = 2;
      canvasCtx.strokeStyle = '#FF6347';

      canvasCtx.beginPath();
      const sliceWidth = (canvas.width * 1.0) / bufferLength;
      let x = 0;

      for (let i = 0; i < bufferLength; i++) {
        const v = dataArray[i] / 128.0;
        const y = (v * canvas.height) / 2;

        if (i === 0) {
          canvasCtx.moveTo(x, y);
        } else {
          canvasCtx.lineTo(x, y);
        }

        x += sliceWidth;
      }

      canvasCtx.lineTo(canvas.width, canvas.height / 2);
      canvasCtx.stroke();
    };

    setIsRecording(true);
    draw();
  };

  const stopRecording = () => {
    setIsRecording(false);
    if (audioContext) {
      audioContext.close();
      setAudioContext(null);
    }
  };

  return (
    <div className="text-center mt-20">
      <h2 className="text-4xl font-bold text-center mb-8">
        Welcome, {location.state.name}. Let's start your interview!
      </h2>

      {/* Interviewer Section */}
      <h3 className="text-2xl font-semibold text-center mb-4">Interviewer</h3>
      <canvas ref={interviewerCanvasRef} width="800" height="150" className="w-full mb-5 bg-gray-200"></canvas>

      {/* Interviewee Section */}
      <h3 className="text-2xl font-semibold text-center mb-4">Interviewee</h3>
      <canvas ref={intervieweeCanvasRef} width="800" height="150" className="w-full mb-5 bg-gray-200"></canvas>

      {isRecording ? (
        <button
          onClick={stopRecording}
          className="bg-red-500 text-white px-4 py-2 rounded"
        >
          Stop Recording
        </button>
      ) : (
        <button
          onClick={startRecording}
          className="bg-green-500 text-white px-4 py-2 rounded"
        >
          Start Recording
        </button>
      )}
    </div>
  );
}

export default InterviewPage;
